import React from 'react';

// import ProgressBar from './ProgressBar';
import Button from './button';

const UserList=(props)=>{
    return(
        <div>
            <h2>Users List</h2>
          <table className="table table-borderd">
              <thead>
                  <th>
                      <td>Name</td>
                      <td>Birth Date</td>
                      <td>Languages</td>
                      <td>Gender</td>
                  </th>
              </thead>
              <tbody>
                  <tr>
                      <td>Xyz</td>
                      <td>Xyz</td>
                      <td>Xyz</td>
                      <td>Xyz</td>
                  </tr>
              </tbody>
          </table>
        </div>
    )
}

export default UserList;
